           u h2{
            animation-name: col;
            animation-duration: 3s;
            animation-iteration-count: infinite;
            width: 200px;
        }
        @keyframes col{
            0%{color: blue;}
            25%{color: red;}
            50%{color: purple;}
            75%{color: black;}
            100%{color: blue;}
        }
        .icon:hover{
            transform: scale(1.1);
            transition-duration: 0.5s;
        }
